import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear and take screenshot
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Check if cart has items
    const cartItems = await page.$$('.cart-item');
    if (cartItems.length === 0) {
      throw new Error('Cart is empty - no items to remove');
    }

    // Remove first item from cart
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.click('.remove-item:first-child');

    // Wait for cart to update and take final screenshot
    await page.waitForTimeout(1000); // Brief pause for UI update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

    // Verify removal by checking cart count
    const cartCount = await page.textContent('.cart');
    const itemCount = parseInt(cartCount.match(/\d+/)?.[0] || '0');

    return {
      success: true,
      action: "Successfully removed item from cart",
      extractedData: {
        cartCount: itemCount,
        itemsRemaining: itemCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
